import { useState } from "react";


function Form (){

    const [searchValue, setSearchValue] = useState({
        city: '',
        state: ''
    })

   const handleFunction = (e) =>{
       e.preventDefault();
       const {name, value} = e.target
        setSearchValue({
            [name]: value
        })
    }


   const submitFunction = (e) =>{
        e.preventDefault();
        console.log(searchValue.city)
        console.log(searchValue.state)
    }



    return(
        <div>
            <form>
            <input 
                name = "state" 
                placeholder = "State"
                onChange = {handleFunction}
                value = {searchValue.state}>
                </input> 
                <input 
                name = "city" 
                placeholder = "City"
                onChange = {handleFunction}
                value = {searchValue.city}>
                </input>

                <button onClick = {submitFunction}>Search!</button>
                <h1>{searchValue.city}</h1>
                <h1>{searchValue.state}</h1>
            </form>
        </div>
    )
}

export default Form;
